import React , {Component} from 'react';
import './App.css';
import Navbar from './components/Navbar';
import NewsComponents from './components/NewsComponents';
import {BrowserRouter,Routes,Route} from 'react-router-dom';
import Error from './components/Error';
export default class App extends Component{
  render(){
    return(
      <>
        <BrowserRouter>
          <Navbar/>
          <Routes>
            <Route exactly path='/' index element={<NewsComponents category=""/>}/>
            <Route exactly path='/' index element={<NewsComponents category=""/>}/>
            <Route exactly path='/political' element={<NewsComponents category="Political"/>}/>
            <Route exactly path='/entertainment' element={<NewsComponents category="Entertainment"/>}/>
            <Route exactly path='/sports' element={<NewsComponents category="Sports"/>}/>
            <Route exactly path='/science' element={<NewsComponents category="Science"/>}/>
            <Route exactly path='*' element={<Error/>}/>
          </Routes>
        </BrowserRouter>
      </>
    )
  }
}
